import logo from './logo.svg';
import './App.css';
import { useState } from 'react';

export default function Counter() {
    const [count, setCount] = useState(5);

    function handleClick() {
        setCount(count + 1);
    }

    const element = (
        <button onClick={handleClick}>
            You pressed me {count} times
        </button>
    );

    return element;
}

